INSERT INTO `product_model` VALUES (2,'Interlocking Circles',6,'These are the first ever pair of earrings that I crocheted and they were super fun to make! They’re really soft and lightweight, perfect for sensitive ears.',1,'2021-02-15 13:26:05','2021-02-15 13:26:05',97),(4,'Hearts',7,'This pair was made specially on Valentine’s Day, just for you! (or a special someone) It’s never too late to show some “hearts” to a loved one.',1,'2021-02-15 13:50:29','2021-02-15 13:50:29',58),(5,'Baby Yoda',5,'A cute lil’ baby yoda keychain! This keychain is inspired by a chibi fan art on Pinterest. Lil’ yoda here is hand drawn on a heat shrink plastic film, baked and finished with a coat of resin.',1,'2021-02-17 14:04:05','2021-02-17 14:04:05',29),(7,'Feisty Flames',6,'Whether you\'re going for a wild night out or to a crazy party, Feisty Flames are the perfect pair of earrings to match the mood! These vibrant pendants also glow under black light, ideal for glow parties!',1,'2021-02-25 17:14:31','2021-02-25 17:14:31',19),(8,'Kitsune',8,'This pair of earrings is inspired by a Japanese traditional fox (Kitsune)   anime mask. There are lots of mask designs of this type, but I personally love this specific design.',1,'2021-02-25 17:27:28','2021-02-25 17:27:28',35),(10,'Red Monarch ',8,'Another pair of butterfly earrings, but in a striking red gradient!\nSuper cute and super light, you won\'t even realize that they\'re fluttering beside you!',1,'2021-02-26 04:52:54','2021-02-26 04:52:54',45),(11,'Monstera',10,'This pair of monstera deliciosa earrings was super tricky to make but overall an enjoyable experience. With an elegant look to them, it seems like the leaves are swaying naturally in the breeze.',1,'2021-02-26 05:07:26','2021-02-26 05:07:26',18),(12,'Irregular Lines',12,'Here’s a pair of irregular-lined polymer clay earrings! These are the first ever pair of polymer clay earrings that I made a few weeks back and they turned out pretty good!',1,'2021-04-20 07:02:36','2021-04-20 07:02:36',6),(13,'Interlocking Circles',6,'Since the teal Interlocking Circles got featured, I’ve decided to make another pair, but in red!',1,'2021-04-20 07:07:12','2021-04-20 07:07:12',13),(15,'Serenity ',10,'This is my first ever perfected alpha keychain! It took me a total of 2 hours to complete this piece and I’m completely satisfied with how it turned out. It would look amazing as an accessory for about anything that you have in hand right now!',1,'2021-04-20 07:26:27','2021-04-20 07:26:27',19);
